import React, {useState} from "react";
import './Coupon.css';

const Coupon = () => {
    return (
        <div className="body">
          <div className="directions">
            Click to spin the wheel to see what prize you won!
          </div>
          <div className="spin-the-wheel">
            <label>
              <input type="radio" />
              <div className="clicker"></div>
              <div className="wheel">
                <div className="option o1">A New Car!</div>
                <div className="option o2">A New Boat!</div>
                <div className="option o3">A New Skateboard!</div>
                <div className="option o4">A New Clipper Card!</div>
              </div>
              <div className="message">
                You won a new clipper card! <br />
                Click to claim your prize.
              </div>
              <a href="http://votion.co" target="_blank"></a>
            </label>
          </div>
        </div>
      );
};

export { Coupon };
